import Contact from "./Pages/Contact"
import Portfolio from "./Pages/Portfolio"

function App() {
  return (
    <div className="App">
      <Navbar />
      {window.location.pathname.includes("/") ? <AboutMe />: window.location.pathname.includes("/")}

      <Contact />
      <Portfolio />


    </div>
  );
}

export default App;
